import './Codelock.css';
import { useState } from 'react';
const Codelock = () => {
    const [buttons, setButtons] = useState([]);

    for (let i = 0; i < 10; i++) {
        buttons.push(<div className="button" id={i}><p>{i}</p></div>)
    }
    buttons.push(buttons.shift());

    return (
        <div className="codelock-container">
            {
                buttons.map((item, id) => {
                    return (
                        <div key={id}>{item}</div>
                    )
                })
            }
        </div>
    )
}

export default Codelock
